import logo from './logo.svg';
import './App.css';

function App() {
  const text = <a href=''>guys</a>;
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1 style={{
          color:'#DF8D98'
        }}>
          Hello, {text}!
        </h1>
        <p>
          There are some changes in <code>src/App.js</code>. It is November, {15} th.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
